sealed class XybridEnvelope {
    data class Audio(
        val `bytes`: ByteArray, 
        val `sampleRate`: UInt, 
        val `channels`: UInt
        ) : XybridEnvelope() {
        companion object
    }
    data class Text(
        val `text`: String, 
        val `voiceId`: String?, 
        val `speed`: Double?
        ) : XybridEnvelope() {
        companion object
    }
    data class Embedding(
        val `data`: List<Float>
        ) : XybridEnvelope() {
        companion object
    }
    

    
    companion object
}

public object FfiConverterTypeXybridEnvelope : FfiConverterRustBuffer<XybridEnvelope>{
    override fun read(buf: ByteBuffer): XybridEnvelope {
        return when(buf.getInt()) {
            1 -> XybridEnvelope.Audio(
                FfiConverterByteArray.read(buf),
                FfiConverterUInt.read(buf),
                FfiConverterUInt.read(buf),
                )
            2 -> XybridEnvelope.Text(
                FfiConverterString.read(buf),
                FfiConverterOptionalString.read(buf),
                FfiConverterOptionalDouble.read(buf),
                )
            3 -> XybridEnvelope.Embedding(
                FfiConverterSequenceFloat.read(buf),
                )
            else -> throw RuntimeException("invalid enum value, something is very wrong!!")
        }
    }

    override fun allocationSize(value: XybridEnvelope) = when(value) {
        is XybridEnvelope.Audio -> {
            // Add the size for the Int that specifies the variant plus the size needed for all fields
            (
                4
                + FfiConverterByteArray.allocationSize(value.`bytes`)
                + FfiConverterUInt.allocationSize(value.`sampleRate`)
                + FfiConverterUInt.allocationSize(value.`channels`)
            )
        }
        is XybridEnvelope.Text -> {
            // Add the size for the Int that specifies the variant plus the size needed for all fields
            (
                4
                + FfiConverterString.allocationSize(value.`text`)
                + FfiConverterOptionalString.allocationSize(value.`voiceId`)
                + FfiConverterOptionalDouble.allocationSize(value.`speed`)
            )
        }
        is XybridEnvelope.Embedding -> {
            // Add the size for the Int that specifies the variant plus the size needed for all fields
            (
                4
                + FfiConverterSequenceFloat.allocationSize(value.`data`)
            )
        }
    }

    override fun write(value: XybridEnvelope, buf: ByteBuffer) {
        when(value) {
            is XybridEnvelope.Audio -> {
                buf.putInt(1)
                FfiConverterByteArray.write(value.`bytes`, buf)
                FfiConverterUInt.write(value.`sampleRate`, buf)
                FfiConverterUInt.write(value.`channels`, buf)
                Unit
            }
            is XybridEnvelope.Text -> {
                buf.putInt(2)
                FfiConverterString.write(value.`text`, buf)
                FfiConverterOptionalString.write(value.`voiceId`, buf)
                FfiConverterOptionalDouble.write(value.`speed`, buf)
                Unit
            }
            is XybridEnvelope.Embedding -> {
                buf.putInt(3)
                FfiConverterSequenceFloat.write(value.`data`, buf)
                Unit
            }
        }.let { /* this makes the `when` an expression, which ensures it is exhaustive */ }
    }
}







